import * as React from 'react';
import {useState} from 'react';
import ReactMapGL, {Marker,Popup} from 'react-map-gl';
import {Room,Star} from "@material-ui/icons";

function App() {

    const [viewport, setViewport] = useState({
        width: '100vw',
        height: '100vh',
        latitude: 46,
        longitude: 17,
        zoom: 4
    });
    return (
        <div className="App">
            <ReactMapGL
                {...viewport} //מחזיק את כל המאפיינים
                mapboxApiAccessToken={process.env.REACT_APP_MAPBOX}
                onViewportChange={nextViewport => setViewport(nextViewport)}
                mapStyle="mapbox://styles/safak/cknndpyfq268f17p53nmpwira"
            >
                <Marker latitude={48.858093} longitude={2.294694} offsetLeft={-20} offsetTop={-10}>
                    <Room style={{fontSize:viewport.zoom * 7,color:'red'}}/>
                </Marker>
                <Popup
                    latitude={48.858093}
                    longitude={2.294694}
                    closeButton={true}
                    closeOnClick={false}
                    anchor="top" >
                    <div className={'card'}>
                        <label>Place</label>
                        <h4 className={'place'}>Eiffel Toure</h4>
                        <label>Review</label>
                        <p>nice very nice place</p>
                        <label>Rating</label>
                        <div className={'stars'}>
                            <Star/>
                            <Star/>
                            <Star/>
                            <Star/>
                            <Star/>
                        </div>
                        <label>Info</label>
                        <span className={'username'}>Created By <b>Liad Ohayon</b></span>
                        <span className={'date'}>1 hour ago</span>
                    </div>
                </Popup>

            </ReactMapGL>
        </div>
    );
}

export default App;
